import { useState } from "react";
const Table = (props) => {
  if( !props.data.etnteredFormData.length ) {
    return;}
    const finalData = [];
  for (let i = 0; i < props.data.length; i++) {
    finalData.push(<tr>
        <td>{props.data.etnteredFormData[i].year}</td>
        <td>{props.data.etnteredFormData[i].savingsEndOfYear}</td>
        <td>{props.data.etnteredFormData[i].yearlyInterest}</td>
        <td>{props.data.etnteredFormData[i].yearlyContribution}</td>
        <td>{props.data.etnteredFormData[i].savingsEndOfYear}</td>
      </tr>)
  }
  console.log(finalData)
  return (
    <table className="result">
      <thead>
        <tr>
          <th>Year</th>
          <th>Total Savings</th>
          <th>Interest (Year)</th>
          <th>Total Interest</th>
          <th>Invested Capital</th>
        </tr>
      </thead>
      <tbody>{finalData}</tbody>
    </table>
  );
};

export default Table;
